import '../Styles/App.css';
import { BrowserRouter as Router, Route, Routes, Navigate,} from "react-router-dom"
import Navbar from './Navbar';
import Holder from './Holder';
import Home from './Home';
import Team from './Team';

function App() {
  return (
    <div>
      <Router>
        <Navbar/>
        <Routes>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/team">
            <Team />
          </Route>
          <Route path="/paint">
            <Holder />
          </Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
